                let maxAmt = 300;
                const totalGrowths = Math.floor((6 * 60 * 60 * 25) / App.game.farming.berryData[berryType].growthTime[3]);
                const totalBerries = totalGrowths * App.game.farming.berryData[berryType].harvestAmount;
